class JOP{constructor(s){this.obj=s}JOPcss(){var js="";for(var i in this.obj){var a=this.obj[i].sl,b=this.obj[i].css,c=this.obj[i].val,sl="document.querySelector('"+a+"')";js+=sl+".style."+String(b)+"='"+String(c)+"'; \n"}return eval(js)}JOPenabled(){var js="";for(var i in this.obj){var a=this.obj[i].sl,b=this.obj[i].val;if("0"===b||"false"===b)var c="true";else if("1"===b||"true"===b)var c="false";else alert("input error");var sl="document.querySelector('"+a+"')";js+=sl+".disabled="+c+"; \n"}return eval(js)}JOPshow(){var js="";for(var i in this.obj){var a=this.obj[i].sl,b=this.obj[i].val;if("0"===b||"false"===b)var c="true";else if("1"===b||"true"===b)var c="false";else alert("input error");var sl="document.querySelector('"+a+"')";js+=sl+".hidden="+c+"; \n"}return eval(js)}JOPhtml(){var js="";for(var i in this.obj){var a=this.obj[i].sl,b=this.obj[i].val,sl="document.querySelector('"+a+"')";js+=sl+".innerHTML='"+b+"'; \n"}return eval(js)}}